import React from "react";
import App from "next/app";
import UserContextProvider from "./comps/context.js";
import { Helmet } from "react-helmet";

class MyApp extends App {
  render() {
    const { Component, pageProps } = this.props;

    return (
      <UserContextProvider>
        <Component {...pageProps} />

        <Helmet>
          <meta charSet="utf-8" />
          <title>Broughton Detailing | Mobile Auto Detailing Matthews, NC</title> />
          <meta name="description" content="Mobile auto detailing in Matthews, NC. Broughton Detailing was founded with the goal of delivering only exceptional results."/>
        </Helmet>
      </UserContextProvider>
    );
  }
}

export default MyApp;
